import {
  Flex,
  HStack,
  Image,
  SimpleGrid,
  Text,
  VStack,
} from "@chakra-ui/react";
import React from "react";

const Index = () => {
  const ProjectCardsRenderer = () => {
    let projectCartTopBarStyle = {
      display: "flex",
      flexDirection: "row",
      justifyContent: "flex-end",
    };
    return (
      <VStack p="1rem" h="100%" w="100%">
        <Flex w="100%" sx={projectCartTopBarStyle}>
          <Text>Web Application</Text>
        </Flex>
        <HStack w="100%">
          <Image />
        </HStack>
      </VStack>
    );
  };

  return (
    <Flex flexDir="column" alignItems="center" mt="100">
      <Text fontSize="25" fontWeight="bold" color="#606060">
        Projects
      </Text>
      <SimpleGrid spacing="20" mt="100" w="100%" columns={[1, null, 2]}>
        <ProjectCardsRenderer />
      </SimpleGrid>
    </Flex>
  );
};

export default Index;
